  return (
    <div className={styles.card}>
      <button style={{display:'none'}} onClick={props.onClose}>x</button>
      <span>{props.name}</span>
      <h4> Max </h4>
      <p>{props.max}</p>
      <h4> Min </h4>
      <p>{props.min}</p>
      <div>
      <img 
        src={`http://openweathermap.org/img/wn/${props.img}@2x.png`}
        alt="clima"
      />
      </div>
    </div>
  );
}
